  02> WILLIAMS, Michelle Karen m on 06.01.1990 to LILLICRAP, Cameron Paul
  b 18.10.1965
  b 19.04.1963
  Michelle b, at Townsville, Qind, Australia and m. at the Chapel of Brisbane Boys' Grammar School.
  Cameron, s/o Paul and Sandra Lillicrap, b. at Brisbane, QInd.
  Michelle was educated at Mundingburra State School, Townsville (1971-73), St Anne's Church of
  England Girls' School, Townsville (1974-82) and University of Queensland, Brisbane (1983-86) from
  which she graduated with a Bachelors Degree in Human Movement Studies (Education). She attained the
  level of Advanced in the Royal Academy of Dance Classical Ballet Exams and all major exams for Tap
  and Modern Dance. She danced with the North Queensland Ballet Company during their 1982 season and
  was awarded the Queensland Government Award for Youth Excellence (Dance) in 1983. She taught
  Physical Education at Harristown State High School, Toowoomba, Qlnd (1987-89) and since 1990 has
  been a travel consultant for Flight Centres, Sunnybank, Qlnd.
  Cameron is a physiotherapist with his own practice in Brisbane. He represented Queensland and
  Australia at rugby union since a schoolboys' tour of England in 1979 and was a loose head prop in
  the Australian Wallaby squad for both the 1987 and 1991 World Cup.
