  03> WILLIAMS, Simon John
  b 28.03.1968
  Simon b. at Townsville, Qind, Australia.
  Simon was educated at St Anne's Church of England Girls' School, Townsville (1973-75), Mundingburra
  State School (1976-77), Toowoomba Church of England Preparatory School (1978-80), Anglican Church
  Grammar School, Brisbane (1981-85) and the University of Queensland, Brisbane (1986-91) from which
  he graduated with Bachelor Degrees in Human Movement Studies (1989) and Physiotherapy (1991). Simon
  played rugby union for the University Club in Brisbane.
  04> WILLIAMS, Joanna Maree
  b 12.06.1969
  Joanna b. at Townsville, Qind, Australia.
  Joanna was educated at St Anne's Church of England Girls' School, Townsville (1975-82), Townsville
  Grammar School (1983-86) where she was Head Prefect in her final year and was awarded the Best
  All-round Student of the Year, and the University of Queensland, Brisbane (1987-90) from which she
  graduated with a Bachelors Degree in Science (Maths and Physics). She joined the Royal Australian
  Navy on 04.03.1991 and at present holds the rank of Midshipman. She completed her basic officer
  training at HMAS Creswell, Jervis Bay, NSW where she was President of the Mess and at times acting
  College Captain. At her Passing Out Parade she was Officer in Charge of the Colour Party. She is
  now doing training in navigation.
